import React, { Component } from "react";
import "./Feladatok.css";
import buttonBack from '../../assets/buttonBack.png'




class Slider extends Component {

  render() {
    var visibility = "hide";
    if (this.props.feladatokVisibility) {
      visibility = "show";
    }

  return (
    <div>
      <div id="flyoutMenu" className={visibility}>
        <div id = 'titleTime'>
          <h1>Feladatok</h1>
        </div>
        <div id = 'floatingButton'>
          <img id = 'buttonBack' src = {buttonBack} onMouseDown={this.props.handleMouseDown} ></img>
        </div>
        <div id = 'timeContainer'>

        </div>
      </div>
    </div>
    );
  }
}
export default Slider;
